/** @jsx jsx */
import { jsx, css } from '@emotion/core';
import React from 'react';
import Layout from '../components/Layout';

const field = css `
  width: 100%;
  height: 56px;
  border-radius: 4px;
  position: relative;
  background-color: rgba(255,255,255,0.3);
  transition: 0.3s all;

  :hover {
    background-color: rgba(255, 255, 255, 0.45);
    box-shadow: 0px 4px 20px 0px rgba(0, 0, 0, 0.05);
  }
  input {
    width: 100%;
    height: 56px;
    position: relative;
    padding: 0px 16px;
    border: none;
    border-radius: 4px;
    font-family: 'Gotham SSm A', 'Gotham SSm B', sans-serif;
    font-size: 16px;
    font-weight: 400;
    line-height: normal;
    background-color: transparent;
    color: #282828;
    outline: none;
    box-shadow: 0px 4px 20px 0px transparent;
    transition: 0.3s background-color ease-in-out, 0.3s box-shadow ease-in-out, 0.1s padding ease-in-out;
    -webkit-appearance: none;
  }
`;
const div = css `
  background-color: grey;
  border-radius: 20px;
`;
function Contact() {
  return (
    <Layout>
      <h1>Contact Me</h1>
      <div css={div}>
        <form action="mailto:meganliles426@gmail.com" method="post" enctype="text/plain">
          <div css={field}>
            <input type="text" placeholder="Name" name="name"></input><br/>
            <input type="text" placeholder="Email" name="mail"></input><br/>
            <input type="text" placehold="Message" name="comment" size="50"/><br/><br/>
            <input type="submit" value="Send"></input>
          </div>
        </form>
      </div>
    </Layout>
  );
}

export default Contact;
